  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:38.238948\",\n\t\"name\": \"a-screening-level-contaminant-survey-of-the-parker-river-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Mean arsenic levels in the three major
  pools were 0.004 ppm for water, 14.1 ppm in sediments, and 0.16 ppm in fish (Table
  1). Levels of arsenic in water from the salt pans were 0.008, 0.0011, and 0.0011
  ppm at sample sites PR-8, PR-9, and PR-10 respectively. No arsenic was detected
  at the well (PR-ll). No mercury was detected in any of the water samples. The mean
  sediment mercury level was 0.27 ppm, and the mean fish mercury level was 1.88 ppm.
  Lead levels were below the detection limit (0.005 ppm) in all of the water samples
  taken from the major pools and one of the salt pans (PR-8). The other two salt pans
  (PR-9 and PR-10), however, had lead levels of 0.052 and 0.40 ppm respectively, and
  the well (PR-ll) had a lead level of 0.15 ppm (Appendix 2). Sediment lead levels
  ranged from 37 ppm at PR-3 to 82 ppm at PR4. No organic contaminants were detected
  in any of the water samples. Mean total aliphatic hydrocarbon levels were 0.76 ppm
  in sediments and 0.35 ppm in fish. The mean total PAH level was 0.22 ppm in sediments
  and 0.46 ppm in fish (Table 1). No aliphatic hydrocarbons or PAHs were detected
  in the eggs. Other organic contaminants found in tissue samples are summarized in
  Table 2.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
